import './App.css';
import React, {useEffect, sueState} from 'react';

function App() {
  useEffect(()=> {
    fetch('/books/all').then(response =>
      response.json().then(data => {
        console.log(data);
      })
    );
  }, [])

  return (<div className="App"/>);
}

export default App;
